import ContactPopup from './components/ContactPopup';
function App() {
  return (
    <div className="App">
        <Header />
        <ContactPopup /> {/* Include the ContactPopup component */}
    <Routes>
      {/* Routes must be used inside a BrowserRouter (already done in index.js) */}
      <Route path="/resume" element={<Resume />} /> 
        {/* Set up different routes */}
        {/* <Route path="/" element={<Resume />} />  Default route */}
        <Route path="/resume" element={<Resume />} />
      </Routes>
    </div>
  );
}

export default App;
